import "../checkout/checkout.styles.scss";

const CheckoutPage = () => {
  return (
    <div className="checkout-page">
      <div className="checkout-header">
        <div className="header-blocks"></div>
      </div>
    </div>
  );
};

export default CheckoutPage;
